import {ADD_QUESTION,} from './actionTypes'

export function addQuestion(question) {
  return {
    type: ADD_QUESTION,
    question
  }
}
export function deleteQuestions(question) {
  return {
    type: DELETE_QUESTIONS,
    question
  }
}
